import './App.css';
import './miCss.css';
import rey1 from './imagenes_actividad/rey_atanagildo.png';
import rey2 from './imagenes_actividad/rey_ataulfo.png';
import rey3 from './imagenes_actividad/rey_ervigio.png';
import rey4 from './imagenes_actividad/rey_incognito.png';
import rey5 from './imagenes_actividad/rey_leogivildo.png';
import rey6 from './imagenes_actividad/rey_recesvinto.png';
import rey7 from './imagenes_actividad/rey_sisebuto.png';
import rey8 from './imagenes_actividad/rey_teodorico.png';


function App() {
  let nombre=["Atanagildo","Ataulfo","Ervigio","Incognito","Leogivildo","Recesvinto","Sisebuto","Teodorico"];
  let caja = <div>Nombre</div>;
  return (
    <div className="fondo">
     <div className='reyes' id='rey1'>
       <img src={rey1}></img>
       <p>{nombre[0]}</p>
     </div>
     <div className='reyes' id='rey2'></div>
     <div className='reyes' id='rey3'></div>
     <div className='reyes' id='rey4'></div>
     <div className='reyes' id='rey5'></div>
     <div className='reyes' id='rey6'></div>
     <div className='reyes' id='rey7'></div>
     <div className='reyes' id='rey8'></div>
    </div>
  );
}

export default App;
